import "./App.css";
import { Route, Routes } from "react-router-dom";
import Home from "./components/Home";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/speak" element={<Speak />} />
        <Route path="/read" element={<Read />} />
        <Route path="/about" element={<About />} />
      </Routes>
    </div>
  );
}

export default App;
